import React from 'react';

const App = () => {
    return (
        <>
                <div className='main_div'>
                    <h1>ToDo List</h1>
                    <input type='text' placeholder='Add Items'></input>
                    <button>+</button>
                </div>
        </>
    )

}

export default App;
